import React, {Component} from 'react';
import './item-status-filter.css';

export default class ItemStatusFilter extends Component {

    buttons = [
        { name: 'all', label: 'All'},
        { name: 'all', label: 'All'},
        { name: 'all', label: 'All'}
    ]

    render() {

        return (
            <div className="item-status btn-group">
                <button type="button"
                        className="btn btn-info">Все
                </button>
                <button type="button"
                        className="btn btn-outline-secondary">Активные
                </button>
                <button type="button"
                        className="btn btn-outline-secondary">Завершенные
                </button>
            </div>
        )
    }
}

